import React, { Fragment } from 'react';

import Navbar from '../../includes/NavBar'
import Footer from '../../includes/Footer'
import Contact from '../../includes/Contact'

function ContactPage() {
    return (
        <Fragment >
            <Navbar />
            <Contact />
            <Footer />
        </Fragment>
    );
}

export default ContactPage;
